function generateOsisKeys(jsonBible) {//**will change if not local */
    let osis = [];
    for (let i = 0; i < OSISBOOKS.length; i++) {
        let book = OSISBOOKS[i];
        for (let j = 0; j < 200; j++) {
            for (let k = 0; k < 200; k++) {
                let key = book + "." + j.toString() + "." + k.toString();
                //console.log(key);
                if (jsonBible.hasOwnProperty(key)) {
                    osis.push(key);
                }
            }
        }
    }
    return osis;
}

